import React from "react";
import { Button, Card, CardContent, Input, InputLabel, Typography, TextField } from "@material-ui/core"

function CreatePost() {
    return (
    <Card>
        <Typography variant="h4" align="center">Create a post</Typography>
        <CardContent className="center-align">
            <InputLabel>Title: </InputLabel>
            <Input placeholder="Title..."></Input>
            <InputLabel>Post: </InputLabel>
            <TextField multiline="true"></TextField>
        </CardContent>
        <Button className="center-align"> Submit </Button>
    </Card>
    );
}

export default CreatePost;
